import * as React from "react";
import { Button as ChakraButton } from "@chakra-ui/core";

export const Button = ({ ...props }) => {
  return (
    <ChakraButton
      borderRadius="lg"
      px={2}
      aria-label={props.children}
      {...props}
    />
  );
};
